function New() {
  return (
    <div>
      <header className="header">
        <h1>Where in the world?</h1>
        <div>
          <span class="material-symbols-outlined">dark_mode</span>
          <p>Dark Mode</p>
        </div>
      </header>
    </div>
  );
}
export default New;
